import React from 'react';

export function Controls(props) {
  return (
    <section className="Controls">
      {props.children}
    </section>
  );
}

export function Visualization(props) {
  return (
    <h1>This will be the visualization pane</h1>
  );
}

export function Complexity(props) {
  return (
    <table className="Complexity">
      <tr>
        <th colspan="2">Complexity</th>
      </tr>
      { props.complexity.map(c => {
        return (
          <tr key={c.name}>
            <td>{c.name}</td>
            <td>{c.complexity}</td>
          </tr>
        )
      })}
    </table>
  );
}

export function About(props) {
  return (
    <section className="About">
      {props.children}
    </section>
  );
}

export default function VisualPage(props) {
  return (
    <article className="VisualPage">
      <h1>{props.title}</h1>
      {props.children}
    </article>
  );
}
